    const {count, topscore, message} = this.props.game[0]
    console.log(this.props.game[0])
    return (

        <div className="container header">
            <h1>Memory Game</h1>
            <p>{count}</p>
            <p>{topscore}</p>
            <h3>{message}</h3>
        </div>
    )
  }
}

export default Header;
